import axios from 'axios'

export const buildUrl = endpoint => {
  const baseUrl = 'https://sandbox.iexapis.com/stable/stock/twtr/chart?token=Tpk_fb982bddddfe4a08b9250c33fe50997d'
  const baseUrlNoTrailingSlash = baseUrl.replace(/\/$/, '')
  // const suffixNoLeadingSlash = endpoint.replace(/^\//, '')
  return baseUrl
}

const AxiosService = {
  get(endpoint, config = {}) {
    console.log(buildUrl(endpoint))
    return axios.get(buildUrl())
  },
  post(endpoint, { data, headers } = {}) {
    return axios({
      url: buildUrl(endpoint),
      method: 'POST',
      headers: headers || { 'Content-Type': 'application/json' },
      data,
    })
  },
  put(endpoint, { data, headers }) {
    return axios({
      url: buildUrl(endpoint),
      method: 'PUT',
      headers: headers || { 'Content-Type': 'application/json' },
      data,
    })
  },
  patch(endpoint, { data }) {
    return axios({
      method: 'PATCH',
      url: buildUrl(endpoint),
      data,
      headers: {
        'Content-Type': 'application/json',
      },
    })
  },
  delete(endpoint) {
    return axios({
      method: 'DELETE',
      url: buildUrl(endpoint),
    })
  },

  registerUnauthorizedListener(router) {
    axios.interceptors.response.use(null, error => {
      if (error.response && [401, 403].includes(error.response.status)) {
        router.push({ name: 'login' })
      } else {
        if (error.response) {
          console.error(error.response)
        } else {
          console.error(error)
        }
      }
      return Promise.reject(error)
    })
  },
}

axios.defaults.withCredentials = true
export default AxiosService
